import logo from './logo.svg';
import './App.css';
import { Switch, Route, Link } from "react-router-dom";
import { TodoPage } from './Pages/TodoPage'
import { BasicTable } from './Components/BasciTable';
import { SortingTable } from './Components/SortingTable';
import "bootstrap/dist/css/bootstrap.min.css";
import "@fortawesome/fontawesome-free/css/all.css";
import "@fortawesome/fontawesome-free/js/all.js";

function App() {
  return (
    <div>
      <nav className="navbar navbar-expand navbar-dark bg-dark">
        <a href="#top" className="navbar-brand">
          user1
        </a>
        <div class="navbar-nav" style="margin-right:70px;">
            <div class="nav-item dropdown">
                <a class="nav-link dropdown-toggle" href="#" id="navbarDropdown" role="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                    <b>Options</b>
                </a>
                <div class="dropdown-menu" aria-labelledby="navbarDropdown">
                <a class="dropdown-item" href="/desconexion">Desconectarse</a>                
                </div>  
            </div>
        </div>
      </nav>

      <div className="container mt-3">
        <Switch>
          <Route exact path={["/", "/user1"]} component={SortingTable} />
          <Route exact path="/user2" component={TodoPage} />
        </Switch>
      </div>
    </div>
  );
}

export default App;
